INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_sliderCaption`, `field_sliderLink`, `field_pageIntro`, `field_contactInfo`, `field_collectionName`, `field_productName`, `field_price`, `field_productInfo`, `field_collectionInfo`, `field_collectionId`, `field_shop`, `field_section`, `field_test`, `field_articleName`, `field_publicationLink`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-12-18 18:11:01', '2013-12-18 18:11:01', 'fb803d4c-7840-4b3f-be5d-831cbf1436bd');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_sliderCaption`, `field_sliderLink`, `field_pageIntro`, `field_contactInfo`, `field_collectionName`, `field_productName`, `field_price`, `field_productInfo`, `field_collectionInfo`, `field_collectionId`, `field_shop`, `field_section`, `field_test`, `field_articleName`, `field_publicationLink`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Homepage', 'Welcome to Blobs!', '<p>Bláithín is a 2011 BDes (Hons) graduate of the National College of Art and Design (NCAD), Dublin. Coupled with her studies in embroidery and a wonderful industry internship with New York based designer Diane Von Furstenberg, she found her niche.</p><p>Within a year of graduating, Blaithin went about setting up her own label ‘Blaithin Ennis’. In early 2012 she launched her first collection of high-end fashion pieces, alongside her range of contemporary jewellery. She stands by her ethos, “A unique accessory can give a new lease of life to the very simple garment”.</p><p>She prides herself on her unique approach and ability to source, manipulate and combine unusual materials from around the world, to produce wearable, special and striking pieces. Her designs have an avant-garde, ethnic motivation behind them. With mixtures of delicate and ro-bust heavy metals, sparkling crystals and soft whimsical shell mesh, her creations represent the ‘unconventional’ in accessories and jewellery. Her use of intricate hand embellishment is simple yet effective, powerful and preciously delicate adding to the couture vibe in her work.The label is affordable and beautifully crafted encorporating simple craft driven techniques. The essence of her collections give women freedom to put their own stamp on design in an elegant way.</p><p>Bláithín is based from her studio in the South east of Ireland where each piece is designed and hand-made.</p>', NULL, NULL, '<p>\r\n	Bláithín Ennis is a 2011 BDes (Hons) graduate of the National College of Art and Design (NCAD), Dublin. Coupled with her studies in embroidery and a wonderful industry internship with New York based designer Diane Von Furstenberg, she found her niche.</p>', '[{\"col1\":\"hello@blaithinennis.com\",\"col2\":\"+353 (0) 87 767 6026\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-12-18 18:11:04', '2014-01-02 17:08:04', '60426b91-f766-4c32-88c5-152ff67c6354');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_sliderCaption`, `field_sliderLink`, `field_pageIntro`, `field_contactInfo`, `field_collectionName`, `field_productName`, `field_price`, `field_productInfo`, `field_collectionInfo`, `field_collectionId`, `field_shop`, `field_section`, `field_test`, `field_articleName`, `field_publicationLink`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '4', 'en_us', 'About', NULL, '<p>\r\n	Bláithín is a 2011 BDes (Hons) graduate of the National College of Art and Design (NCAD), Dublin. Coupled with her studies in embroidery and a wonderful industry internship with New York based designer Diane Von Furstenberg, she found her niche.</p><p>\r\n	Within a year of graduating, Blaithin went about setting up her own label ‘Blaithin Ennis’. In early 2012 she launched her first collection of high-end fashion pieces, alongside her range of contemporary jewellery. She stands by her ethos, “A unique accessory can give a new lease of life to the very simple garment”.</p><p>\r\n	She prides herself on her unique approach and ability to source, manipulate and combine unusual materials from around the world, to produce wearable, special and striking pieces. Her designs have an avant-garde, ethnic motivation behind them. With mixtures of delicate and ro-bust heavy metals, sparkling crystals and soft whimsical shell mesh, her creations represent the ‘unconventional’ in accessories and jewellery. Her use of intricate hand embellishment is simple yet effective, powerful and preciously delicate adding to the couture vibe in her work.The label is affordable and beautifully crafted encorporating simple craft driven techniques. The essence of her collections give women freedom to put their own stamp on design in an elegant way.</p><p>\r\n	Bláithín is based from her studio in the South east of Ireland where each piece is designed and hand-made.</p>', NULL, NULL, '<p>\r\n	Bláithín Ennis is a 2011 BDes (Hons) graduate of the National College of Art and Design (NCAD), Dublin. Coupled with her studies in embroidery and a wonderful industry internship with New York based designer Diane Von Furstenberg, she found her niche.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-12-20 17:01:04', '2014-01-02 17:16:28', 'b5db51ef-a1c1-45b3-9a58-5fa2a1993834');
