INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_sliderCaption`, `field_sliderLink`, `field_pageIntro`, `field_contactInfo`, `field_collectionName`, `field_productName`, `field_price`, `field_productInfo`, `field_collectionInfo`, `field_collectionId`, `field_shop`, `field_section`, `field_test`, `field_articleName`, `field_publicationLink`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('9', '9', 'en_us', 'Press', NULL, NULL, NULL, NULL, '<p>Bláithín’s creations have received a great deal of press attention over the past year, with regular articles and features in the Sunday Independent, Life magazine, Stellar, Tatler, Image, Ireland Am, TV3 and The Voice of Ireland. She was delighted when her Karelian cuff and Teardrop earrings were worn by X-Factor judge Nicole Scherzinger during a performance with Gary Barlow on New Years Day. She was also one of five Irish designers chosen to represent Cadburys with the launch of their new range of ‘Crispello’ products. Each designer was commissioned to make a piece inspired by the product. These are currently featuring on XPOSE and will continue to feature throughout 2013.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-12-20 17:03:59', '2014-01-03 14:54:16', '6b342bd1-d08d-4fb4-a4e7-12f969215297');
