INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('9', '2', '1', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1387390264,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>Bl\\u00e1ith\\u00edn is a 2011 BDes (Hons) graduate of the National College of Art and Design (NCAD), Dublin. Coupled with her studies in embroidery and a wonderful industry internship with New York based designer Diane Von Furstenberg, she found her niche.<\\/p><p>Within a year of graduating, Blaithin went about setting up her own label \\u2018Blaithin Ennis\\u2019. In early 2012 she launched her first collection of high-end fashion pieces, alongside her range of contemporary jewellery. She stands by her ethos, \\u201cA unique accessory can give a new lease of life to the very simple garment\\u201d.<\\/p><p>She prides herself on her unique approach and ability to source, manipulate and combine unusual materials from around the world, to produce wearable, special and striking pieces. Her designs have an avant-garde, ethnic motivation behind them. With mixtures of delicate and ro-bust heavy metals, sparkling crystals and soft whimsical shell mesh, her creations represent the \\u2018unconventional\\u2019 in accessories and jewellery. Her use of intricate hand embellishment is simple yet effective, powerful and preciously delicate adding to the couture vibe in her work.The label is affordable and beautifully crafted encorporating simple craft driven techniques. The essence of her collections give women freedom to put their own stamp on design in an elegant way.<\\/p><p>Bl\\u00e1ith\\u00edn is based from her studio in the South east of Ireland where each piece is designed and hand-made.<\\/p>\",\"11\":[{\"col1\":\"\",\"col2\":\"\"}],\"1\":\"Welcome to Blobs!\",\"7\":[\"10\"],\"9\":[\"11\"],\"8\":[\"12\"],\"10\":\"<p>mother fucker<\\/p>\",\"4\":[\"16\"]}}', '2014-01-02 15:42:48', '2014-01-02 15:42:48', 'd4adef2d-94f9-4647-89f3-66e3580a2ac9');
