INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('44', '17', '9', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"Collections\",\"slug\":\"collections\",\"postDate\":1388687748,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"Hello\",\"10\":\"<p>Bl\\u00e1ith\\u00edn Ennis is a 2011 BDes (Hons) graduate of the National College of Art and Design (NCAD), Dublin. Coupled with her studies in embroidery and a wonderful industry internship with New York based designer Diane Von Furstenberg, she found her niche.<\\/p>\"}}', '2014-01-03 12:18:37', '2014-01-03 12:18:37', '78c10937-bf64-474b-9fc7-e082d87b2da8');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('57', '9', '7', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"Press\",\"slug\":\"press\",\"postDate\":1387559039,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"10\":\"<p>Bl\\u00e1ith\\u00edn\\u2019s creations have received a great deal of press attention over the past year, with regular articles and features in the Sunday Independent, Life magazine, Stellar, Tatler, Image, Ireland Am, TV3 and The Voice of Ireland. She was delighted when her Karelian cuff and Teardrop earrings were worn by X-Factor judge Nicole Scherzinger during a performance with Gary Barlow on New Years Day. She was also one of five Irish designers chosen to represent Cadburys with the launch of their new range of \\u2018Crispello\\u2019 products. Each designer was commissioned to make a piece inspired by the product. These are currently featuring on XPOSE and will continue to feature throughout 2013.<\\/p>\"}}', '2014-01-03 14:48:54', '2014-01-03 14:48:54', '52db4427-4ed7-4a38-b9cc-e67c5c80b131');
