INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('4', 'field', '2', 'en_us', ' blaithin is a 2011 bdes hons graduate of the national college of art and design ncad dublin coupled with her studies in embroidery and a wonderful industry internship with new york based designer diane von furstenberg she found her niche within a year of graduating blaithin went about setting up her own label blaithin ennis in early 2012 she launched her first collection of high end fashion pieces alongside her range of contemporary jewellery she stands by her ethos a unique accessory can give a new lease of life to the very simple garment she prides herself on her unique approach and ability to source manipulate and combine unusual materials from around the world to produce wearable special and striking pieces her designs have an avant garde ethnic motivation behind them with mixtures of delicate and ro bust heavy metals sparkling crystals and soft whimsical shell mesh her creations represent the unconventional in accessories and jewellery her use of intricate hand embellishment is simple yet effective powerful and preciously delicate adding to the couture vibe in her work the label is affordable and beautifully crafted encorporating simple craft driven techniques the essence of her collections give women freedom to put their own stamp on design in an elegant way blaithin is based from her studio in the south east of ireland where each piece is designed and hand made ');
